method OnRequest
   /+ &_MSG as Message +/
   /+ Returns Message +/
   /+ Extends/implements PS_PT:Integration:IRequestHandler.OnRequest +/

   Local Message &request, &response;

   &request = &_MSG;

   Local Document &reqDOC;

   &reqDOC = &request.GetURIDocument();

   Local string &UserCode;
   Local number &CompanyCode, &ProcessCode, &i;
   Local Rowset &RsNovelty;

   /***Obtener parametros**/
   &UserCode = &reqDOC.GetElement("UserCode").value;
   &CompanyCode = &reqDOC.GetElement("CompanyCode").value;
   &ProcessCode = &reqDOC.GetElement("ProcessCode").value;

   &RsNovelty = CreateRowset(Record.ETY_LIS_NOV_WRK);

   For &i = 1 To &RsNovelty.ActiveRowCount
      /*&COMP1 = &COLL0.CreateItem();*/
      &reqDOC.GetElement("DocumentType").value = &RsNovelty(&i).GetRecord(Record.ETY_LIS_NOV_WRK).GetField(Field.DOCUMENT_TYPE).Value;
      &reqDOC.GetElement("DocumentNumber").value = &RsNovelty(&i).GetRecord(Record.ETY_LIS_NOV_WRK).GetField(Field.DOCUMENT_ID).Value;
      &reqDOC.GetElement("NoveltyCode").value = &RsNovelty(&i).GetRecord(Record.ETY_LIS_NOV_WRK).GetField(Field.NOVELTY_CODE).Value;
      &reqDOC.GetElement("NoveltyCause").value = &RsNovelty(&i).GetRecord(Record.ETY_LIS_NOV_WRK).GetField(Field.NOVELTY_CAUSE).Value;
      &reqDOC.GetElement("RetirementDate").value = &RsNovelty(&i).GetRecord(Record.ETY_LIS_NOV_WRK).GetField(Field.CLOSED_DATE).Value;
      /*&status = &COLL0.AppendItem(&COMP1);*/
   End-For;


   &response = CreateMessage(Operation.C_REST_ECHO_GET, %IntBroker_Response);

   Local XmlDoc &xmlout;
   Local XmlNode &childNode;

   &xmlout = CreateXmlDoc("<?xml version='1.0'?><response/>");

   &childNode = &xmlout.DocumentElement.AddElement("UserCode").AddText(&UserCode);

   &response.SetXmlDoc(&xmlout);

   Return &response;

end-method;


